        /// </summary>
        /// <param name="sender"></param>
        public string getHighlightMapNo(string strCityCode)
        {
            string strMapNo = "";
            try
            {
                for (int i = 0; i < _RegionItem.Count; i++)
                {
                    if (_RegionItem[i].CityCode == strCityCode)
                    {
                        return _RegionItem[i].HighMapNo;
                    }
                }


